Crunchy and tasty, twiisted #pizza is the perfect idea for a delicious appetizer! 

INGREDIENTS
2 sheets (around 400 g) puff pastry;
25 g (2 tbsp) tomato paste;
200 g (1 cup) shredded cheese;
2 tbsp chopped parsley;
½ tsp oregano;
Melted butter;
Egg wash;
Parmesan cheese.
METHOD
Roll out 2 sheets of puff pastry.
Spread tomato paste on one sheet and sprinkle oregano on top.
Top with cheese and parsley, cover with another sheet of pastry, and brush melted butter on top.
Cut the puff pastry sandwich into strips. Press each strip in the middle with a skewer, then twist as shown in the video.
Brush with egg wash, top with parmesan cheese, and bake for 25 minutes at 190C/375F.

